import { Button, Checkbox, Form, Input, Radio, message } from 'antd';
import React from 'react';
import axios from 'axios';

const Login = () => {
  const onFinish = (values) => {
    axios.get("http://localhost:3001/getUsers", { user: values.username, pass: values.password }).then((response) => {
      if (response == null) message.error("This username is unavailable.")
      else {
        message.error("This username is available")
      }
    })
    console.log(values);
  };

  const onChange = (e) => {
    console.log(`radio checked:${e.target.value}`);
  };

  return (
    <Form
      name="basic"
      labelCol={{
        span: 8,
      }}
      wrapperCol={{
        span: 16,
      }}
      initialValues={{
        remember: true,
      }}
      onFinish={onFinish}
      autoComplete="off"
    >
      <Form.Item
        label=""
        name="usertype"
        rules={[
          {
            required: true,
            message: 'Please choose a value!',
          },
        ]}
      >
        <Radio.Group onChange={onChange} defaultValue="a">
          <Radio.Button value="a">New</Radio.Button>
          <Radio.Button value="b">Returning</Radio.Button>
        </Radio.Group>
      </Form.Item>

      <Form.Item
        label="Username"
        name="username"
        rules={[
          {
            required: true,
            message: 'Please input your username!',
          },
        ]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Password"
        name="password"
        rules={[
          {
            required: true,
            message: 'Please input your password!',
          },
        ]}
      >
        <Input.Password />
      </Form.Item>

      <Form.Item
        name="remember"
        valuePropName="checked"
        wrapperCol={{
          offset: 8,
          span: 16,
        }}
      >
        <Checkbox>Remember me</Checkbox>
      </Form.Item>

      <Form.Item
        wrapperCol={{
          offset: 8,
          span: 16,
        }}
      >
        <Button type="primary" htmlType="submit">
          Submit
        </Button>
      </Form.Item>
    </Form>
  );
};

export default Login;
